import '../styles/home.css'


const Home = () => {

  const[foodCat,setFoodCat]=useState([]);
  const[fooditems,setFoodItems]=useState(["first"]);

  // useEffect(()=>{
  //   LoadData()

  // })





  windows.onload= async()=>{
    let responseData = await fetch("http://localhost:5500/api/foodData")
    .then(response=>response.json())
    .then(data=>{
      console.log(data)

      const p= data.map((a)=>{
        return(

          <div className='maindiv'>
      <div className="card" style={{"width": "18rem"}}>
  <img className="card-img-top" src="" alt="Card image cap"/>
  <div className="card-body">
    <h5 className="card-title">{a}</h5>
    <p className="card-text">{}</p>
    <a href="#" className="btn btn-primary">{}</a>
  </div>
</div>
    </div>

        )
      })


    setFoodItems(p)
    })
  }










  return (
    <div className='shop'>
      <h1>My shop</h1>
      <div>
        {fooditems}
      </div>
    </div>
  )
}

export default Home
